    "2013-03-14T19:30:21.450582",nt"name": "stream-habitat-reach-summary-north-coast-ds63",nt"isopen":
    false,nt"url": null,nt"notes": "The shapefile is based on habitat unit
    level data summarized at the stream reach level. The database represents salmonid
    stream habitat surveys from 645 streams of the California North Coast Hydrologic
    Region (Calwater 2.2.1) from 1989 to 2003 with most effort in 1995 and 1996. Approximately
    1,622 miles of streams were surveyed. The data were collected by Department of Fish
    and Game and contractors according to the version of the "California Stream Habitat
    Restoration Manual" that was current in the year of survey (see References). The
    methods used in the 1991 edition were used until the 1994 edition was released.
    Two important differences are that the 1994 version incorporated a revised stream
    channel classification system, affecting the way stream reaches are described and
    a protocol for large woody debris was added. The third edition (Flosi et al. 1998)
    is available on-line. Habitat typing follows a modified version of the system described
    in Bisson et al, 1982. Stream channel typing follows Rosgen 1994, beginning with
    the 1995 field season. The database helps identify and describe in-stream habitat
    available to anadromous salmonids within watersheds surveyed. WHAT EACH RECORD REPRESENTS
    Each record represents in-stream habitat unit attributes summarized at the stream
    reach level. A habitat unit is the base level for the stream habitat surveys and
    is generally determined by the occurrence of riffle, run and pool sections along
    the stream. Stream reaches are determined by changes in stream channel type as described
    by Rosgen (1994)",nt"license_title": null,nt"extras": [{ntt"key":
